CEREBRAL CORTEX diseases; 
THALAMIC DISEASES; 
BASAL GANGLIA DISEASES; injury to the 
RED NUCLEUS; and other conditions.

*Narcolepsy.note:
A condition characterized by recurrent episodes of daytime somnolence and lapses in consciousness (microsomnias) that may be associated with automatic behaviors and AMNESIA. CATAPLEXY; 
