OBESITY; 
OSTEOPOROSIS; 
HYPERTENSION; 
DIABETES MELLITUS; 
HIRSUTISM; 
AMENORRHEA; and excess body fluid. Endogenous Cushing syndrome or spontaneous hypercortisolism is divided into two groups, those due to an excess of 
ADRENOCORTICOTROPIN and those that are ACTH-independent.;99(66)

