*Hypoglycemia.note:
A syndrome of abnormally low 
BLOOD GLUCOSE level. Clinical hypoglycemia has diverse etiologies. Severe hypoglycemia eventually lead to glucose deprivation of the 
CENTRAL NERVOUS SYSTEM resulting in 
HUNGER; 
SWEATING; 
PARESTHESIA; impaired mental function; 
SEIZURES; 
COMA; and even 
DEATH.

*Hypoxia-Ischemia, Brain.note:
A disorder characterized by a reduction of oxygen in the blood combined with reduced blood flow (
ISCHEMIA) to the brain from a localized obstruction of a cerebral artery or from systemic hypoperfusion. Prolonged hypoxia-ischemia is associated with 
ISCHEMIC ATTACK, TRANSIENT; 
BRAIN INFARCTION; 
BRAIN EDEMA; 
COMA; and other conditions.;2000

*Neuronal Ceroid-Lipofuscinoses.note:
A group of severe neurodegenerative diseases characterized by intracellular accumulation of autofluorescent wax-like lipid materials (
CEROID; 
LIPOFUSCIN) in neurons. There are several subtypes based on mutations of the various genes, time of disease onset, and severity of the neurological defects such as progressive 
DEMENTIA; 
SEIZURES; and visual failure.;2007 (1983)

Spinocerebellar Ataxias/*congenital.note:
A group of dominantly inherited, predominately late-onset, cerebellar ataxias which have been divided into multiple subtypes based on clinical features and genetic mapping. Progressive ataxia is a central feature of these conditions, and in certain subtypes 
POLYNEUROPATHY; 
DYSARTHRIA; visual loss; and other disorders may develop. (From Joynt, Clinical Neurology, 1997, Ch65, pp 12-17; J Neuropathol Exp Neurol 1998 Jun;57(6):531-43);2000; use SPINOCEREBELLAR DEGENERATION 1987-1999

Paraplegia/*congenital.note:
Severe or complete loss of motor function in the lower extremities and lower portions of the trunk. This condition is most often associated with 
SPINAL CORD DISEASES, although 
BRAIN DISEASES; 
PERIPHERAL NERVOUS SYSTEM DISEASES; 
NEUROMUSCULAR DISEASES; and 
MUSCULAR DISEASES may also cause bilateral leg weakness.;1963

*Ataxia.note:
Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharynx, larynx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or 
PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with 
CEREBELLAR DISEASES; 
CEREBRAL CORTEX diseases; 
THALAMIC DISEASES; 
BASAL GANGLIA DISEASES; injury to the 
RED NUCLEUS; and other conditions.

*Holoprosencephaly.note:
Anterior midline brain, cranial, and facial malformations resulting from the failure of the embryonic prosencephalon to undergo segmentation and cleavage. Alobar prosencephaly is the most severe form and features anophthalmia; cyclopia; severe 
INTELLECTUAL DISABILITY; 
CLEFT LIP; 
CLEFT PALATE; 
SEIZURES; and microcephaly. Semilobar holoprosencepaly is characterized by hypotelorism, microphthalmia, coloboma, nasal malformations, and variable degrees of 
INTELLECTUAL DISABILITY. Lobar holoprosencephaly is associated with mild (or absent) facial malformations and intellectual abilities that range from mild 
INTELLECTUAL DISABILITY to normal. Holoprosencephaly is associated with 
CHROMOSOME ABNORMALITIES.;91

