*Hypopituitarism.note:
Diminution or cessation of secretion of one or more hormones from the anterior pituitary gland (including LH; 
FOLLICLE STIMULATING HORMONE; 
SOMATOTROPIN; and 
CORTICOTROPIN). This may result from surgical or radiation ablation, non-secretory 
PITUITARY NEOPLASMS, metastatic tumors, infarction, 
PITUITARY APOPLEXY, infiltrative or granulomatous processes, and other conditions.;1963; for SIMMONDS' DISEASE &amp; SHEEHAN'S SYNDROME use SIMMONDS' DISEASE 1963-1967

*Neuronal Ceroid-Lipofuscinoses.note:
A group of severe neurodegenerative diseases characterized by intracellular accumulation of autofluorescent wax-like lipid materials (
CEROID; 
LIPOFUSCIN) in neurons. There are several subtypes based on mutations of the various genes, time of disease onset, and severity of the neurological defects such as progressive 
DEMENTIA; 
SEIZURES; and visual failure.;2007 (1983)

*Cockayne Syndrome.note:
A syndrome characterized by multiple system abnormalities including 
DWARFISM; 
PHOTOSENSITIVITY DISORDERS; 
PREMATURE AGING; and 
HEARING LOSS. It is caused by mutations of a number of autosomal recessive genes encoding proteins that involve transcriptional-coupled 
DNA REPAIR processes. Cockayne syndrome is classified by the severity and age of onset. Type I (classical; CSA) is early childhood onset in the second year of life; type II (congenital; CSB) is early onset at birth with severe symptoms; type III (xeroderma pigmentosum; XP) is late childhood onset with mild symptoms.;1991(1981); use DWARFISM 1981-1990

*Megalencephaly.note:
A congenital abnormality in which the occipitofrontal circumference is greater than two standard deviations above the mean for a given age. It is associated with 
HYDROCEPHALUS; 
SUBDURAL EFFUSION; 
ARACHNOID CYSTS; or is part of a genetic condition (e.g., 
ALEXANDER DISEASE; 
SOTOS SYNDROME).;2011; use Macrocephaly 2011-2014, Megalencephaly was under Macrocephaly 2011-2014

*Olivopontocerebellar Atrophies.note:
A group of inherited and sporadic disorders which share progressive ataxia in combination with atrophy of the 
CEREBELLUM; 
PONS; and inferior olivary nuclei. Additional clinical features may include 
MUSCLE RIGIDITY; 
NYSTAGMUS, PATHOLOGIC; 
RETINAL DEGENERATION; 
MUSCLE SPASTICITY; 
DEMENTIA; 
URINARY INCONTINENCE; and 
OPHTHALMOPLEGIA. The familial form has an earlier onset (second decade) and may feature spinal cord atrophy. The sporadic form tends to present in the fifth or sixth decade, and is considered a clinical subtype of 
MULTIPLE SYSTEM ATROPHY. (From Adams et al., Principles of Neurology, 6th ed, p1085);2000(1987)

*Ataxia.note:
Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharynx, larynx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or 
PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with 
CEREBELLAR DISEASES; 
CEREBRAL CORTEX diseases; 
THALAMIC DISEASES; 
BASAL GANGLIA DISEASES; injury to the 
RED NUCLEUS; and other conditions.

*Muscle Cramp.note:
A sustained and usually painful contraction of muscle fibers. This may occur as an isolated phenomenon or as a manifestation of an underlying disease process (e.g., 
UREMIA; 
HYPOTHYROIDISM; 
MOTOR NEURON DISEASE; etc.). (From Adams et al., Principles of Neurology, 6th ed, p1398)

*Spasms, Infantile.note:
An epileptic syndrome characterized by the triad of infantile spasms, hypsarrhythmia, and arrest of psychomotor development at seizure onset. The majority present between 3-12 months of age, with spasms consisting of combinations of brief flexor or extensor movements of the head, trunk, and limbs. The condition is divided into two forms: cryptogenic (idiopathic) and symptomatic (secondary to a known disease process such as intrauterine infections; nervous system abnormalities; 
BRAIN DISEASES, METABOLIC, INBORN; prematurity; perinatal asphyxia; 
TUBEROUS SCLEROSIS; etc.). (From Menkes, Textbook of Child Neurology, 5th ed, pp744-8);1977(1963)

