*Blood Coagulation Disorders.note:
Hemorrhagic and thrombotic disorders that occur as a consequence of abnormalities in blood coagulation due to a variety of factors such as 
COAGULATION PROTEIN DISORDERS; 
BLOOD PLATELET DISORDERS; 
BLOOD PROTEIN DISORDERS or nutritional conditions.

