SUBDURAL EFFUSION; 
ARACHNOID CYSTS; or is part of a genetic condition (e.g., 
ALEXANDER DISEASE; 
SOTOS SYNDROME).;2011; use Macrocephaly 2011-2014, Megalencephaly was under Macrocephaly 2011-2014

*Language Development Disorders.note:
Conditions characterized by language abilities (comprehension and expression of speech and writing) that are below the expected level for a given age, generally in the absence of an intellectual impairment. These conditions may be associated with 
DEAFNESS; 
BRAIN DISEASES; 
MENTAL DISORDERS; or environmental factors.;1986(1980)

*Muscular Dystrophy, Emery-Dreifuss.note:
A heterogenous group of inherited muscular dystrophy without the involvement of nervous system. The disease is characterized by 
MUSCULAR ATROPHY; 
MUSCLE WEAKNESS; 
CONTRACTURE of the elbows; 
ACHILLES TENDON; and posterior cervical muscles; with or without cardiac features. There are several 
INHERITANCE PATTERNS including X-linked (X 
CHROMOSOME), autosomal dominant, and autosomal recessive gene mutations.;2000; for MUSCULAR DYSTROPHY, SCAPULOPERONEAL use MUSCULAR DYSTROPHIES 2000-2004

*Brain Diseases.note:
Pathologic conditions affecting the 
BRAIN, which is composed of the intracranial components of the 
CENTRAL NERVOUS SYSTEM. This includes (but is not limited to) the 
CEREBRAL CORTEX; intracranial white matter; 
BASAL GANGLIA; 
THALAMUS; 
HYPOTHALAMUS; 
BRAIN STEM; and 
CEREBELLUM.

*Bardet-Biedl Syndrome.note:
