RETINITIS PIGMENTOSA; 
POLYDACTYLY; 
OBESITY; 
MENTAL RETARDATION; hypogenitalism; renal dysplasia; and short stature. This syndrome has been distinguished as a separate entity from 
LAURENCE-MOON SYNDROME. (From J Med Genet 1997 Feb;34(2):92-8);2000

